data:
  definition: canal d'accès destiné principalement à la signalisation usager-réseau
  examples: []
  notes:
  - Les canaux D peuvent servir à la signalisation d'usager à usager et à la transmission
    de données en mode paquet.
  - On a défini des canaux D avec des débits numériques de 16 kbit/s et 64 kbit/s.
